import React, { useState, useEffect } from 'react';
import './home.css';
import Header from './header.js';

const Home = () => {


    return (
        <div className="homepage">
            <div className='header-div'>
                <Header />
            </div>
                <div className="welcome-text">
                    <h1>Welcome to Our Website!</h1>
                </div>
        
                <div className="tiles-container">
                    <div className="tile">
                        <img src="./assets/bg.png" alt="Tile 1" />
                        <h2>Tile 1</h2>
                    </div>
                    <div className="tile">
                        <img src="./assets/logo.png" alt="Tile 2" />
                        <h2>Tile 2</h2>
                    </div>
                </div>
        </div>
    );
};

export default Home;
